import { AppBar, Toolbar, Typography, styled } from '@mui/material'
import React from 'react'
const StyledToolBar = styled(Toolbar)({
    display:"flex",
    justifyContent:"space-between",
});
export const Navbar = () => {
  return (
   <AppBar>
    <StyledToolBar>
        <Typography variant='h6'>
            CATER PİE
        </Typography>
    </StyledToolBar>
   </AppBar>
  )
}
